import styled from 'styled-components'

export const ResultsHeader = styled.h2`
  font-size: 2rem;
  font-weight: 600;
  text-transform: capitalize;
  color: #888;
  margin-bottom: 1.5rem;
`
export const Wrapper = styled.div`
  display: flex;
  flex-direction: column;
  flex-grow: 1;
  padding: 2rem 5rem;
  overflow-y: scroll;
`
